INSERT INTO `hub_embeds` VALUES
(1,'main','','***Step into an unexplored reality and find meaning and hidden truth behind it\'s existence.\n\nAssemble your party and compete with other players, or enter alone. \n\nChoose your class + difficulty level, and experience turn-based combat that challenges your strategy at every turn.***','https://cdn.discordapp.com/attachments/1362832151485354065/1367115629408292974/12346.png?ex=68136925&is=681217a5&hm=dd0bfd5013c7add42b3a4033f1bad6367b99b54ecb70b43a0e1d0071678091a0&','**AdventureBot v3.0.8 is now Live!**\n\n__**Beta Testers:**__\n\nPatch 3.0.9 features have been partially implemented for testing.\n\nPlease use the bug report channel if you come across any issues.\n\nAlso before posting any errors please check the https://discord.com/channels/1337786582996095036/1371280451259334736 for more info.',NULL,'2025-03-31 08:43:19'),
(2,'tutorial','Starting A Game','\nSimply click the **New Game** button to create a new game thread.\n\nThis will add you to the **Queue** system inside the thread, along with anyone else who wants to join.\n\n- Only the players who join the game session will see the private thread and be added to it automatically.\n\n- Up to 6 players can join via the LFG post in the Game Channel by clicking the Join button. \n\n- Additional players will be shown in the **Queue List** in the thread.\n\nWhen the creator is ready they may click **Start Game** to lock in the emount of players playing.\n\n\n','https://cdn.discordapp.com/attachments/1362832151485354065/1373622234865733652/Screenshot_2025-05-18_at_6.14.47_AM.png?ex=682b14e5&is=6829c365&hm=b91a3c24ed88f1f493db9a8f61473923e316e284782ab15bd565f6a82ac25966&','Coming Soon...',1,'2025-04-15 02:50:10'),
(3,'tutorial','Choose Class and Difficulty','Once the Session Creator clicks the Start Game button they can choose their class and difficulty level.\n\n- Selecting **Easy** will generate up to 2 floors with a rare chance to spawn a basement floor. In this mode most harder enemeis are removed from generation.\n\n- Choosing **Medium** difficulty will generate up to 4 floors with at least 2 and a rare chance to spawn a basement. In this mode harder enemies spawn along side easy ones during generation.\n\n- Selecting **Hard** is exactly what you think it is. With up to 4 floors and higher spawn chances on more difficult enemies and less vendor shops and item drops.\n\n- **Crazy Catto** is the most difficult of challenges and well... you\'d be a crazy catto to try it.','https://cdn.discordapp.com/attachments/1362832151485354065/1373622403455778848/Screenshot_2025-05-18_at_6.19.11_AM.png?ex=682b150d&is=6829c38d&hm=045419693ca1ecd758f7ecf5c7208ca4da321622636b908da9e15c99f97dde61&','Coming Soon...',2,'2025-04-17 03:45:05');
INSERT INTO `intro_steps` VALUES
(1,1,'An Unexpected Discovery','During what began as an ordinary raid, Sophia paused. The usual golden glow marking the entrance to familiar realms was absent, replaced instead by a strange portal shimmering with dark, translucent crystals. Curious murmurs rippled through the raid group‚Ä¶\n\nSophia:‚Ä®\"This... isn\'t the gate we\'re used to. Has anyone seen anything like this before?\"','https://cdn.discordapp.com/attachments/1362832151485354065/1364793339538440232/step1.png?ex=680f9398&is=680e4218&hm=7832e0e8397c563e8c86ab6846989f63af51cd786cf8c2c8427d3c5d5f8b3466&','2025-03-31 07:40:47'),
(2,2,'Mog\'s Bold Venture','As the group hesitated, Mog, the courageous Moogle companion, hovered near the mysterious entrance, eyes wide with intrigue.\n\nMog:‚Ä®\"Let me scout it out, Kupo! Moogles portal hop all the time! If there\'s trouble, I\'ll zip right back!\"\n\nWithout another word, Mog vanished through the darkened portal.','https://cdn.discordapp.com/attachments/1362832151485354065/1364793340331298897/step2.png?ex=680f9398&is=680e4218&hm=50cb0c034376bb47248d7e4c495cd482280dae41d394938288aa6ad1774b6c3f&','2025-03-31 07:40:47'),
(3,3,'The Moogle Returns','Moments felt like hours as the group waited anxiously. Suddenly, Mog burst back through, visibly shaken.\n\nMog:‚Ä®\"It\'s... a labyrinth inside! Dark and scary, I almost got lost and I felt like something was watching me, kupo. We should not enter unprepared.\"','https://cdn.discordapp.com/attachments/1362832151485354065/1364793384673345678/step3.png?ex=680f93a3&is=680e4223&hm=19e1ab5d83d39dac7d0b9b74928ec577cb26b2b2e1068cb8a0fe8aaf77bfc3b3&','2025-03-31 07:40:47'),
(4,4,'Sophia\'s Decision','Sophia nodded solemnly, her gaze steady yet filled with resolve.\n\nSophia:‚Ä®\"This discovery can\'t be ignored. Whatever lies beyond this portal demands our attention‚Äîbut Mog\'s right. This will require strength, courage, and careful preparation.\"','https://cdn.discordapp.com/attachments/1362832151485354065/1364793385319272448/step4.png?ex=680f93a3&is=680e4223&hm=241e407e45048a1ba2109c2e2a4fa5f33c2d22d205f25d0566323c380fc6699a&','2025-04-09 14:37:27'),
(5,5,'The Call to Adventure','Returning to their Free Company house, Sophia gathered everyone, her voice clear and inspiring.\n\nSophia:‚Ä®\"Friends, we\'ve faced many challenges, but now an unknown labyrinth awaits us. The dangers are uncertain, but the potential rewards‚Äîand truths‚Äîare greater still. Will you join me in unraveling this mystery? Our next journey begins now.\"\n\nYour adventure starts here...','https://cdn.discordapp.com/attachments/1362832151485354065/1364793386246209566/step5.png?ex=680f93a3&is=680e4223&hm=7d3793a1b0558d849b78340bc31465049d07f7e6136ab91eba21504f8603c016&','2025-04-09 14:37:27');
