(2215,341,2,'Artemecion','__**Artemecion:**__\n\n\"Hey there, Kupo! Do you need a Letter delivered perhaps? No? Hmph, well I also sell a few wares I find along my journey, kupo.\"\n\n*Artemecion looks at you for a moment and it looks as though he\'s trying to recall something...*\n\n\"Sorry... your face reminds me of someone I haven\'t seen in a long time, kupo. I was lost in a good memory for a moment. \n\nPlease feel free to browse, but my dyes are off limits, kupo!\"','https://cdn.discordapp.com/attachments/1362832151485354065/1376308818199445604/Artemecion.gif?ex=6834daf8&is=68338978&hm=16ecf8b4fff715e695e67f6c647a7dc918bf8cfb0486ac383cb337e22f380efd&','2025-05-25 21:41:15'),
